import React from 'react';
import styles from './ScanSummary.module.css'

function ScanSummary() {
  const dummyData = {
    url: 'https://example.com',
    cookies: 8,
    trackers: 5,
    riskrate: 'C+',
    date:'30 April,2025',
    origin:'India',
    ip:'156.2356.215',
    density:'xxxx'
  };

  const handleBlockCookies = () => {
    alert('Cookies would be blocked (simulation)');
    // Here, you can later implement real blocking logic
  };

  return (
    <div className={styles.container}>
      <div className={styles.card}>
      <h1>Scan Summary</h1>
      <p><strong>Website:</strong> {dummyData.url}</p>
      <p><strong>Date of scan:</strong> {dummyData.date}</p>
      <p><strong>Total Cookies Detected:</strong> {dummyData.cookies}</p>
      <p><strong>Total Trackers Found:</strong> {dummyData.trackers}</p>
      <p><strong>Trackers origin:</strong> {dummyData.origin}</p>
      <p><strong>IP Address:</strong> {dummyData.ip}</p>
      <p><strong>Density:</strong> {dummyData.density}</p>
      <p><strong>Risk rate:</strong> {dummyData.riskrate}</p>
      
      <button className={styles.pbtton} onClick={handleBlockCookies}>Block Cookies</button>
    </div>
    <div className={styles.footer}>
    <p className={styles.footp}>Built with passion, precision, and a commitment to your security. Made with ❤️ by “CODE CREATURES”.</p>
    </div>
    </div>
  );
}

export default ScanSummary;
